import { TweenMax } from 'gsap';

export interface FadeInProps {
  ifTableRow: boolean;
  children: any;
}

const FadeIn: React.SFC<FadeInProps> = (props) => {
  useEffect(() => {
    TweenMax.to(`.animate`, 1, {
      opacity: 1,
    });
  });

  return (
    <div className="animate">
      {console.log(props)}
      {/* {children} */}
    </div>
  );
};

export default FadeIn;
